import React, {useState} from 'react';

import GetVehicleType from './GetVehicleType';
import SearchManufacturer from './SearchManufacturer';
import SearchModel from './SearchModel';
import SearchModelYear from './SearchModelYear';

function VehicleSearchPanel(props) {

    const [searchFlag, setSearchFlag] = useState(false);
    const [searchAgainFlag, setSearchAgainFlag] = useState(false);

    const [vehicleType, setVehicleType] = useState(null);
    const [manufacturer, setManufacturer] = useState(null);
    const [model, setModel] = useState(null);
    const [modelYear, setModelYear] = useState(null);

    //TEMPORARY

    // console.log("Manufacturer: ", manufacturer);
    // console.log("VehicleType: ", vehicleType);
    console.log("Model: ", model);
    console.log("ModelYear: ", modelYear);

    return (

        <div>
            <GetVehicleType searchAgainFlag={searchAgainFlag} setVehicleType={setVehicleType}/>
            {vehicleType && <SearchManufacturer vehicleType={vehicleType} setManufacturer={setManufacturer}/>}
            {vehicleType && manufacturer && <SearchModel vehicleType={vehicleType} manufacturer={manufacturer} setModel={setModel}/>}
            {vehicleType && manufacturer && model && <SearchModelYear vehicleType={vehicleType} manufacturer={manufacturer} model={model} setModelYear={setModelYear}/>}
            {vehicleType && manufacturer && model && modelYear && !searchFlag && <button onClick={() => { if(!searchFlag){setSearchFlag(true)} } }>Pesquisar</button>}
            {vehicleType && manufacturer && model && modelYear && searchFlag && <ShowVehicleInformation/>}
        </div>
    )

}

export default VehicleSearchPanel;
